import React, { useEffect } from "react"
import CheckCookie from "./checkCookie"

export default function Splash() {

    useEffect( () => {
        console.log( "Splash" )

		CheckCookie() ?
		history.push( "/frontpage" ) :
		history.push( "/access" )
    }, [])

    return (
        <div className="container">
            Splash
        </div >
    )
}
